.about {
  width: 100%;
  height: 100%;
  position: fixed;
  top: 0;
  left: 0;
  background-image: url("../../../assets/yingzhi/bg_img.png");
  background-repeat: no-repeat;
  background-size: 100%;
}
/* 头部标签 */
.header {
  height: 8%;
  width: 100%;
  margin-bottom: 10px;
  background-image: url("../../../assets/yingzhi/topback.png");
  background-repeat: no-repeat;
  background-size: 100%;
}
.daoy {
  position: relative;
  left: 20px;
  top: 5px;
  z-index: 999;
}
.header_text {
  width: 30%;
  text-align: center;
  color: #fff;
  line-height: 50px;
  font-size: 20px;
  letter-spacing: 10px;
  float: left;
  position: absolute;
  left: 50%;
  top: 0%;
  margin-left: -15%;
}
.echarts_box{
  width: 100%;
  height: calc(100% - 8%);
  padding: 0 23px 30px 23px;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
}
.echarts_box .left{
  width: calc((100% - 8.5px)*0.6);
  height: 100%;
}
/deep/.amap-logo{
  left: -200px!important;
}
/deep/.amap-copyright{
  left:-500px !important;
}
.echarts_box .right{
  width: calc((100% - 8.5px)*0.4);
  height: 100%;
}
.right .top{
  position:relative;
  width: 100%;
  height:calc((100% - 10px)*0.45);
  padding: 10px 9px 10px 9px;
}
.right .bottom{
  position:relative;
  margin-top: 10px;
  width: 100%;
  height:calc((100% - 10px)*0.55);
  padding: 10px 9px 10px 9px;
}
.right .top .title, .right .bottom .title{
  width: 100%;
  text-align: center;
  font-size:15px;
  font-family:Adobe Heiti Std;
  font-weight:normal;
  color:rgba(255,252,1,1);
}
.chart_title{
  width: 100%;
  height: 10px;
  position: relative;
}
.chart_title span{
  position: absolute;
  display: inline-block;
  font-size:9px;
  font-family:Adobe Heiti Std;
  font-weight:normal;
  color:rgba(255,255,255,1);
  line-height:19px;
}
.chart_title .into{
  left: 18%;
  top: 0;
}
.chart_title .out{
  right: 18%;
  top: 0 ;
}
.tab_table {
  width: 100%;
  height: calc(100% -17px -17px - 20px);
  margin-top: 10px;
}
.tab_table tr{
  width: 100%;
  height: 20px;
  font-size:12px;
  font-family:Adobe Heiti Std;
  color:rgba(255,255,255,1);
}
.tab_table tr:nth-child(1){
  font-weight: 400;
}
.tab_table tr td{
  text-align:center;
}
.times {
  width: 100%;
  height:20px;
  display: flex;
  justify-content: space-between;
  flex-flow: row nowrap;
  list-style: none;
  margin: 15px 0 0 0 ;
  padding: 0;
}
.times li {
  position: relative;
  width: 80px;
  height: 20px;
  border-radius:3px;
}
.times li span{
  display: inline-block;
}
.times li .time{
  width: 100%;
  height: 100%;
  text-align: center;
  line-height:17px;
  font-size:9px;
  font-family:PingFang SC;
  font-weight:500;
  color:rgba(255,255,255,1);
  letter-spacing:2px;
  border-radius: 3px;
}
.times li .opa{
  position:absolute;
  top: 0;
  left:0;
  width:100%;
  height:100%;
  border-radius:3px;
  background:#5B7AB0;
  opacity: 0.4;
  z-index: -1;
}
.times li:nth-child(3) .time{
  background: #fff;
  font-family:PingFang SC;
  font-weight:500;
  color:rgba(0,0,0,1);
}
